import React from 'react'
import { View, StyleSheet } from 'react-native'
import Category from './Category.jsx'

import { 
  faPaintRoller, faBorderAll,faBold, faFaucet, faWrench,
  faTools, faStream, faSink, faPencilRuler, faClone
 } from '@fortawesome/free-solid-svg-icons'

 // faSun se ve como rueda de configuración

export default function ListCategories() {
  const items = [
    { name: 'Home', icon: faPaintRoller, title: 'Pinturas' },
    { name: 'Offers', icon: faBorderAll, title: 'Construcción' },
    { name: 'Favourites', icon: faBold, title: 'Electricidad' },
    { name: 'Order', icon: faFaucet, title: 'Herramientas' },
    { name: 'Profile', icon: faWrench, title: 'Ferretería' },

    { name: 'Home1', icon: faTools, title: 'Inicio' },
    { name: 'Offers2', icon: faStream, title: 'Maderas' },
    { name: 'Favourites3', icon: faSink, title: 'Grifería' },
    { name: 'Order4', icon: faPencilRuler, title: 'Serv. & Ins.' },
    { name: 'Profile5', icon: faClone, title: 'Pisos' },
  ]

  return(
    <View style={styles.container}>
      {items.map((item, index) => {
        return(
          <Category data={item} key={index}/>
        )
      })}
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    width: '100%',
    height: 150,
    flexWrap: 'wrap',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginTop: 20,
    marginBottom: 20,
  }
})
